Polymorphism allows objects of different types to be treated as objects of a common base type. C++ supports polymorphism through virtual functions and pointers. Here's a simplified example: // Base class with a virtual function
class Animal {
public: virtual void makeSound() { // Base class implementation }
}; // Derived classes
class Dog : public Animal {
public: void makeSound() override { // Dog's implementation }
}; class Cat : public Animal {
public: void makeSound() override { // Cat's implementation }
}; // Using polymorphism
