In C++, specific keywords are designed to enhance performance by providing valuable optimizations, commonly used examples are: const: Informs the compiler that a variable's value will remain constant, allowing for optimizations based on this information. #include <iostream> int main() { const int x = 10; // Declare a constant variable // x = 20; // This would result in a compilation error, as x is constant. This allows the compiler to make optimizations std::cout << "The value of x is: " << x << std::endl; return 0;
} inline: Guides the compiler to replace function calls with the actual code of the function (but doesn't have to), improving execution speed. #include <iostream> // Inline function definition
inline int add(int a, int b) { return a + b;
} int main() { int result = add(5, 7); // Compiler may replace this with actual code std::cout << "The result is: " << result << std::endl; return 0;
} constexpr: Signals that a function or variable can be computed at compile time, contributing to runtime efficiency. #include <iostream> // constexpr function for compile-time computation
constexpr int square(int x) { return x * x;
} int main() { const int value = 5; constexpr int squaredValue = square(value); // Computed at compile time std::cout << "The square of " << value << " is: " << squaredValue << std::endl; return 0;
}

